import React from 'react';
import {

          MDBInputGroup,
} from 'mdb-react-ui-kit';
const Move = () => {
          return (
                    <>
                              <div>
                                        <MDBInputGroup className='mb-3' size='sm' textBefore='Small'>
                                                  <label htmlFor=""></label>
                                                  <input className='form-control' type='text'  />
                                        </MDBInputGroup>

                              </div>
                    </>
          );
}
export default Move;
